// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// import "./Whitelist.sol";
// import "./Ownable.sol";

import "@openzeppelin/contracts/access/Ownable.sol";

contract CustomSupCh is Ownable {

  string public name;
  uint private productCount = 0;
  mapping(uint => Product) public items;
  enum State{Create,Sold,Shipped}

  struct Product {
      uint id;
      string name;
      State state;
      uint price;
      address payable supplier;
  }

  mapping(address => bool) public whitelistedAddresses;

  event WhitelistedEvent(address a);

  // <LogSetRequirements event>
  event LogSetRequirements(string storedData);
  

  // <LogSold event>
  event LogSold(string storedData);

  // <LogShipped event>
  event LogShipped(string storedData);

  // <LogReceived event>
  event LogReceived(string storedData);

  event ProductCreated(
      uint id,
      string name,
      State state,
      uint price,
      address payable supplier
  );

  event ProductPurchased(
      uint id,
      string name,
      uint price,
      address payable owner
  );

  constructor () {
  }

    function addWhitelistedUser(address _addressToWhitelist) public onlyOwner {
        whitelistedAddresses[_addressToWhitelist] = true;
        emit WhitelistedEvent(_addressToWhitelist);
    }

    modifier isWhitelisted(address _address) {
        require(whitelistedAddresses[_address], "You are not Whitelisted");
        _;
    }

    function whitelisted() public view isWhitelisted(msg.sender) returns(bool) {
        return(true);
    }


  modifier verifyCaller (address _address) {
    require (msg.sender == _address);
    _;
  }

  modifier paidEnough(uint _price) {
    require(msg.value >= _price);
    _;
  }
  
  // //modifier SetRequirements
  // modifier SetRequirements(uint _id) {
  // require(items[_id].state == State.SetRequirements);
  // require(items[_id].supplier != address(0));
  // _;
  // }

  //modifier sold
  modifier sold(uint _id) {
    require( items[_id].state== State.Sold);
    _;
  }

  //modifier shipped
  modifier shipped(uint _id) {
    require(items[_id].state == State.Shipped);
    _;
  }

  //modifier received
  // modifier received(uint _id) {
  //   require(items[_id].state == State.Received);
  //   _;
  // }

  function getProductCount() public view returns(uint256){
    return(productCount);
  }

  function createProduct(string memory _name, uint _price) public isWhitelisted(msg.sender) { //onlyWhitelisted
    // Require a valid name
    require(bytes(_name).length > 0);
    // Require a valid price
    require(_price > 0);
    // Increment product count
    productCount ++;
    // Create the product
    items[productCount] = Product(productCount, _name, State.Create, _price, payable(msg.sender));
    // Trigger an event
    emit ProductCreated(productCount, _name, State.Create, _price, payable(msg.sender));
  }

  // function addSupplier(address su) public onlyOwner{
  //   addWhitelistedUser(su);
  //   // addAddressToWhitelist(su);
  //   emit WhitelistedEvent(su);
  // }

  function buyItem(uint id) payable public paidEnough(items[id].price){
    (bool sent, bytes memory data) = items[id].supplier.call{value: items[id].price}("");
    require(sent, "Failed");
    // items[id].buyer = payable(msg.sender);
    items[id].state=State.Sold;
    emit LogSold(name);
  }

  function shipItem(uint id) public sold(id) verifyCaller(items[id].supplier){
    items[id].state=State.Shipped;
    emit LogShipped(name);
  }

  // function receiveItem(uint id) public shipped(id) verifyCaller(items[id].buyer) {
  // items[id].state=State.Received;
  // emit LogReceived(name);
  // }

}
